import React from 'react';
import { Card, Avatar, Button } from 'antd';

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="twit">
          seoreu
          <br />
        </div>,
        <div key="follings">
          프로젝트
          <br />0
        </div>,
        <div key="follwers">
          팔로워
          <br />0
        </div>,
      ]}
    >
      <Card.Meta avatar={<Avatar>HJY</Avatar>} title="종윤" />
      <Button>로그아웃</Button>
    </Card>
  );
};

export default UserProfile;
